import React, { useState, useEffect } from 'react';
import { FaClock, FaCalendarCheck, FaSignOutAlt, FaPlaneDeparture, FaFileAlt } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import apiService from './api/apiService';
import { useAuth } from './AuthContext';
import './App.css';

const Dashboard = () => {
  const navigate = useNavigate();
  const { user, logout } = useAuth();

  // State for data fetched from API
  const [attendanceHistory, setAttendanceHistory] = useState([]);
  const [travelLogs, setTravelLogs] = useState([]);
  const [leaveRequests, setLeaveRequests] = useState([]);
  const [todaysAttendance, setTodaysAttendance] = useState(null);
  const [loading, setLoading] = useState(true);

  // State for forms
  const [travelPurpose, setTravelPurpose] = useState('');
  const [travelStartLocation, setTravelStartLocation] = useState('');

  const [leaveType, setLeaveType] = useState('sick');
  const [leaveReason, setLeaveReason] = useState('');
  const [leaveStartDate, setLeaveStartDate] = useState('');
  const [leaveEndDate, setLeaveEndDate] = useState('');

  const isClockedIn = todaysAttendance && !todaysAttendance.clock_out_time;

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const [attendanceRes, travelRes, leaveRes, todayRes] = await Promise.all([
          apiService.get('/attendance/history'),
          apiService.get('/trips'),
          apiService.get('/leave/history'),
          apiService.get('/attendance/today'),
        ]);
        setAttendanceHistory(attendanceRes.data.data);
        setTravelLogs(travelRes.data.data);
        setLeaveRequests(leaveRes.data.data);
        setTodaysAttendance(todayRes.data);
      } catch (error) {
        console.error("Failed to fetch dashboard data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleClockInOut = async () => {
    try {
      const position = await new Promise((resolve, reject) => {
        navigator.geolocation.getCurrentPosition(resolve, reject);
      });
      const { latitude, longitude } = position.coords;

      const endpoint = isClockedIn ? '/attendance/clock-out' : '/attendance/clock-in';
      const response = await apiService.post(endpoint, { latitude, longitude });

      setTodaysAttendance(response.data.attendance);
      // Refresh history
      const historyRes = await apiService.get('/attendance/history');
      setAttendanceHistory(historyRes.data.data);

    } catch (error) {
      console.error('Clock-in/out failed:', error);
      alert('Could not perform clock-in/out. Please ensure location services are enabled.');
    }
  };

  const handleTravelLogSubmit = async (e) => {
    e.preventDefault();
    try {
        const position = await new Promise((resolve, reject) => {
            navigator.geolocation.getCurrentPosition(resolve, reject);
        });
        const { latitude, longitude } = position.coords;

        const response = await apiService.post('/trips/start', {
            purpose: travelPurpose,
            start_location: travelStartLocation,
            start_latitude: latitude,
            start_longitude: longitude,
        });
        setTravelLogs(prev => [response.data.trip, ...prev]);
        setTravelPurpose('');
        setTravelStartLocation('');
        alert('Trip started successfully!');
    } catch (error) {
        console.error('Failed to start trip:', error);
        alert('Failed to start trip. You may have an active trip already.');
    }
  };

  const handleLeaveRequestSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await apiService.post('/leave/request', {
        leave_type: leaveType,
        reason: leaveReason,
        start_date: leaveStartDate,
        end_date: leaveEndDate,
      });
      setLeaveRequests(prev => [response.data.leave_request, ...prev]);
      setLeaveType('sick');
      setLeaveReason('');
      setLeaveStartDate('');
      setLeaveEndDate('');
      alert('Leave request submitted successfully.');
    } catch (error) {
      console.error('Failed to submit leave request:', error);
      alert('Failed to submit leave request. Please check the details and try again.');
    }
  };

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <h2>Welcome, {user?.name}</h2>
        <button className="btn btn-danger" onClick={logout}>
          <FaSignOutAlt /> Logout
        </button>
      </div>

      {loading ? <p>Loading...</p> : (
        <div className="dashboard-content">
          <div className="section clock-in-out">
            <h3><FaClock /> Attendance</h3>
            <p>{isClockedIn ? `Clocked In at: ${new Date(todaysAttendance.clock_in_time).toLocaleTimeString()}` : 'You are not clocked in.'}</p>
            <button onClick={handleClockInOut} className={`btn ${isClockedIn ? 'btn-danger' : 'btn-success'}`}>
              {isClockedIn ? 'Clock Out' : 'Clock In'}
            </button>
          </div>

          <div className="section travel-logs">
            <h3><FaPlaneDeparture /> Start a New Trip</h3>
            <form onSubmit={handleTravelLogSubmit}>
              <input type="text" placeholder="Purpose of Trip" value={travelPurpose} onChange={(e) => setTravelPurpose(e.target.value)} required />
              <input type="text" placeholder="Starting Location (e.g., Office)" value={travelStartLocation} onChange={(e) => setTravelStartLocation(e.target.value)} required />
              <button type="submit" className="btn btn-primary">Start Trip</button>
            </form>
          </div>

          <div className="section leave-requests">
            <h3><FaFileAlt /> Submit Leave Request</h3>
            <form onSubmit={handleLeaveRequestSubmit}>
              <select value={leaveType} onChange={(e) => setLeaveType(e.target.value)} required>
                <option value="sick">Sick</option>
                <option value="casual">Casual</option>
                <option value="paid">Paid</option>
              </select>
              <input type="date" value={leaveStartDate} onChange={(e) => setLeaveStartDate(e.target.value)} required />
              <input type="date" value={leaveEndDate} onChange={(e) => setLeaveEndDate(e.target.value)} required />
              <textarea placeholder="Reason for leave" value={leaveReason} onChange={(e) => setLeaveReason(e.target.value)} required />
              <button type="submit" className="btn btn-primary">Submit Request</button>
            </form>
          </div>

          <div className="section">
            <h3><FaCalendarCheck /> My Attendance History</h3>
            <table className="table table-bordered">
              <thead><tr><th>Date</th><th>Clock In</th><th>Clock Out</th><th>Worked Hours</th></tr></thead>
              <tbody>
                {attendanceHistory.length > 0 ? attendanceHistory.map(log => (
                  <tr key={log.id}>
                    <td>{new Date(log.clock_in_time).toLocaleDateString()}</td>
                    <td>{new Date(log.clock_in_time).toLocaleTimeString()}</td>
                    <td>{log.clock_out_time ? new Date(log.clock_out_time).toLocaleTimeString() : 'N/A'}</td>
                    <td>{log.worked_hours || 'N/A'}</td>
                  </tr>
                )) : <tr><td colSpan="4">No records found.</td></tr>}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
